he people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHHCY":{"type":"number","alias":"2023 Total Households","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Households","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Families","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGECY":{"type":"number","alias":"2023 Median Age","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINCCY":{"type":"number","alias":"2023 Median Household Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVALCY":{"type":"number","alias":"2023 Median Home Value","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSHAICY":{"type":"number","alias":"2023 Housing Affordability Index","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are l ng in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKTOTHHCY":{"id":"TOTHH_CY","fullName":"AtRisk.TOTHH_CY","alias":"2023 Total Households","fieldName":"ATRISKTOTHHCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTHHCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2023-2028 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a i Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVALCY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2023 Median Home Value","fieldName":"KEYUSFACTSMEDVALCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVALCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHAICY":{"id":"HAI_CY","fullName":"housingunittotals.HAI_CY","alias":"2023 Housing Affordability Index","fieldName":"HOUSINGUNITTOTALSHAICY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHAICY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001AB_P":{"id":"MP19001A_B_P","fullName":"ElectronicsInternet.MP19001A_B_P","alias":"2023 Have Internet Access at Home: Percent","fieldName":"ELECTRONICSINTERNETMP19001AB_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001AB_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Have Internet Access at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19003AB":{"id":"MP19003A_B","fullName":"ElectronicsInternet.MP19003A_B","alias":"2023 Cable Modem Internet Connection at Home","fieldName":"ELECTRONICSINTERNETMP19003AB","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ELECTRONICSINTERNETMP19003AB","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Cable Modem Connection to Internet at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific
